import React from "react";
import Loader from "../../Loader/Loader";

const ProfileStatus = (props) => {
    if (props.profile) {
        return <Loader/>
    }

    return (
        <>
            <div>
                <span>{props.status}</span>
            </div>
            <div>
                <input value={props.status}></input>
            </div>
        </>
    )
}

export default ProfileStatus;
